const axios=require('axios')
var data;
async function fun(){
    try {
        data=await axios.get("http://localhost:3001")
        console.log(data["data"].json())
    } catch (error) {
        console.log("hello")
        console.log(error)
    }
    
        
}
fun();

//data="shubham"
module.export = data
